import React, { useState } from 'react';

import { introAndEndData } from './core.js';

import { Container } from 'react-bootstrap'

import {
  Route,
  Switch,
  NavLink,
  HashRouter
} from "react-router-dom";
import Home from "./home.js";
import TextFiles from "./textfiles.js";


import EtIDNav from './EtIDNav.js';
import EtIDSelection from './EtIDSelection.js';
import EtIDDownload from './EtIDDownload.js';
import EtIDHeader from './EtIDHeader.js';
import EtIDAdvSet from './EtIDAdvSet.js';
import EtIDFooter from './EtIDFooter.js';

window.onload = function() {
  introAndEndData();
};

const App = () => (
    <>

    <EtIDNav />
    <Container fluid className="p-3">
    <HashRouter>
            <div className="content">
                <Route exact path="/" component={Home}/>
                <Route path="/textfiles" component={TextFiles}/>
              </div>

    </HashRouter>

    </Container>
    <EtIDFooter/>
   </>
    );


export default App;
